import React from 'react';
import { ImageData } from './ImageData.js';

const ImageSlider = () => {
  return (
    <>{ImageData.map((slide, index)=>{
        return (
            <img src={slide.image} alt="cat-image"/>
        )
    })}</>
  )
}

export default ImageSlider
